import React from "react"
import Axios from 'axios'
import {Route, Switch} from 'react-router-dom'
import {UserInfo, Menu, Main, AboutProducts} from '../components'
import './MainPage.css'

function MainPage() {

  const [products, setProducts] = React.useState([]);
  const [category, setCategory] = React.useState([]);

  React.useEffect(() => {
    Axios.get('http://localhost:3000/db.json').then(({data}) => {
      setProducts(data)
    })
  }, []);

  React.useEffect(() => {
    Axios.get('http://localhost:3000/food_fdc_id.json').then(({data}) => {
      setCategory(data)
      console.log(category)
    })
  }, []);

  
  console.log(category)

  var arr= [
    {
      "fdc_id": 319874,
      "data_type": "sample_food",
      "description": "HUMMUS, SABRA CLASSIC",
      "food_category_id": 16,
      "publication_date": "2019-04-01"
    },
    {
      "fdc_id": 319877,
      "data_type": "sub_sample_food",
      "description": "Hummus",
      "food_category_id": 16,
      "publication_date": "2019-04-01"
    }, 
    {
      "fdc_id": 319894,
      "data_type": "sample_food",
      "description": "HUMMUS, OTHER",
      "food_category_id": 16,
      "publication_date": "2019-04-01"
    },
    {
      "fdc_id": 319895,
      "data_type": "market_acquisition",
      "description": "HUMMUS, OTHER",
      "food_category_id": 16,
      "publication_date": "2019-04-01"
    },
    {
      "fdc_id": 319896,
      "data_type": "market_acquisition",
      "description": "HUMMUS, OTHER",
      "food_category_id": 16,
      "publication_date": "2019-04-01"
    },
    {
      "fdc_id": 319897,
      "data_type": "market_acquisition",
      "description": "HUMMUS, OTHER",
      "food_category_id": 16,
      "publication_date": "2019-04-01"
    },
    {
      "fdc_id": 319898,
      "data_type": "market_acquisition",
      "description": "HUMMUS, OTHER",
      "food_category_id": 16,
      "publication_date": "2019-04-01"
    },
    {
      "fdc_id": 319899,
      "data_type": "sub_sample_food",
      "description": "Hummus",
      "food_category_id": 16,
      "publication_date": "2019-04-01"
    }]
  var temp=[];
  arr=arr.filter((x, i)=> {
    if (temp.indexOf(x.description) < 0) {
      temp.push(x.description);
      return true;
    }
    return false;
  })
  console.log(arr);

  return (
    <div className="main-block">
      <div className="left-block">
        {/*<UserInfo/>*/}
        <Menu
          onChange={(name) => alert(name)}
          items={
            [
              {
                label: 'О продуктах',
                path: '/about',
              }
            ]
          }/>
          <div>
            <h1><a href="http://esh.by">ESH.BY</a></h1>
            <span onClick={setCategory}>@2021 Все права защищены</span>
          </div>
      </div>
      <div className="right-block">
        <Switch>
          <Route path="/main">
            <Main/>
          </Route>
          <Route path="/about">
            <AboutProducts items={products}/>
          </Route>
        </Switch>
      </div>
    </div>
  )
}

export default MainPage
